import React from "react";
import { Link, Outlet } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <nav>
      <Link to="/vegetable">Vegetable</Link>
      <Link to="/fruit">Fruit</Link>
      <Link to="/contact">Contact</Link>

      <Outlet />
    </nav>
  );
};

export default Header;
